import React from "react";

class CompNavbar extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div class="topnav">
        <a class="active" href="#home">
          Home
        </a>
        <a href="#news">News</a>
        <a href="#contact">Contact</a>
        <a href="#about">About</a>
      </div>
    );
  }
}

export default CompNavbar;
